import React from 'react'

export default function Home() {
  return (
    <div>
     <h1
        style={{
          background: `linear-gradient(
            14deg,
            rgba(2, 0, 36, 0.8) 0%,
            rgba(24, 24, 65, 0.7) 66%,
            rgb(20, 76, 99) 100%
          ),
          radial-gradient(
            circle,
            rgba(2, 0, 36, 0.5) 0%,
            rgba(32, 15, 53, 0.2) 65%,
            rgba(14, 29, 28, 0.9) 100%
          )`,
          WebkitBackgroundClip: 'text',
          color: 'transparent',
        }}
      >
        Add gradient to this text
      </h1>
    </div>
  )
}
